text:
As Israel starves babies in Gaza, this moment of manufactured crisis demands moral clarity &amp; decisive action from the US.

I'm joining @RepPressley &amp; @RepPettersen in calling on @SecRubio to facilitate the delivery of aid &amp;
baby formula immediately.

For 50+ years, MAX Environmental has poisoned Yukon’s air, water, and soil, leaving families sick and land unsafe.

Today I saw it up close and heard from residents.

@EPA and @PennsylvaniaDEP must hold MAX accountable so every family can breathe clean air and trust their water. https://t.co/ycRGLi3oGt

We can’t expect students to succeed in school when they don’t even know where they’ll sleep at night.

@homelessfund412 is doing the life-saving work to support our students facing housing instability.

Grateful to stand with them and speak to the urgency of action. https://t.co/cMlXa40T5f

It isn’t fair that college athletes bring in millions to their schools without being paid for their labor.

@ChrisMurphyCT and I reintroduced a bill to ensure college athletes across the country can collectively bargain and unionize.

They deserve a seat at the negotiating table. https://t.co/8NHwrbGhTW

First a judge, now a Member of Congress. 

This administration is trying to intimidate our branches of government to circumvent checks and balances.

@RepLaMonica was exercising her lawful duty to conduct Congressional oversight. I stand with her.
